// Header.jsx
import React from "react";
import { Link } from "react-router-dom";
import SearchBar from "./Search"; // Import the SearchBar component
import Loginbutton from "./loginbutton";
import Registerbutton from "./registerbutton";
import Logoutbutton from "./logoutbutton";
import Allrecipiesbutton from "./allrecepiesbutton";

const signedin = localStorage.getItem("signedin");

function Header() {
  return (
    <header className="header">
      {/* Logo and other header elements */}
      <a href="/">
        <img src="assets/logo.png" alt="Logo" className="logo" />
      </a>

      {/* Include the SearchBar in the header */}
      <SearchBar />

      {/* Authentication Buttons */}
      <div className="auth-buttons">
        <Allrecipiesbutton />
        {signedin === "false" ? (
          <>
            <Loginbutton />
            <Registerbutton />
          </>
        ) : (
          <>
            <span>Hello, welcome again</span>
            <Logoutbutton />
          </>
        )}
      </div>
    </header>
  );
}

export default Header;
